ISLAMABAD, Oct 7 (APP): Egyptian Ambassador to Pakistan Tarek Mohamed Hussein Dahroug Wednesday called on Minister for Aviation Ghulam Sarwar Khan and discussed matters pertaining to mutual interest.
During the meeting, the two sides underlined the need for increased bilateral cooperation in diverse fields especially the aviation sector, a news release said.
